import React from 'react'
import {CreateAncmntLotContainer} from '@src/components/announcement/create_ancmnt_lot/CreateAncmntLotContainer'
import {withTranslation} from "next-i18next";

const Create = (props) => {
    return <CreateAncmntLotContainer {...props} />
}

Create.getInitialProps = async () => ({
    namespacesRequired: ['ancmnt', 'common'],
});

export default withTranslation(['ancmnt', 'common'])(Create);
